    <Card style={{ elevation: 5, backgroundColor: "#dfe6e9" }}>
      <Image
        style={{
          height: 80,
          width: 80,
          borderRadius: 40,
        }}
        source={{
          uri: props.photo,
        }}
      />
      <Title>{props.name}</Title>
      <Paragraph>{props.chat}</Paragraph>
    </Card>
  );
}
